import React, { useState } from "react";
import { Navbar, NavTabs } from "../components";
import Pagination from "@material-ui/lab/Pagination";
import { makeStyles, Grid } from "@material-ui/core";
import Divider from "@mui/material/Divider";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: "#78935d",
    color: "white",
  },
  title: {
    flexGrow: 1,
    textAlign: "center",
    fontWeight: 600,
  },
  pageTitle: {
    fontSize: "20px",
    fontWeight: 500,
    margin: "20px",
  },
  cardImage: {
    height: "300px",
    textAlign: "center",
    boxShadow: "0 6px 10px rgba(0,0,0,.08), 0 0 6px rgba(0,0,0,.05)",
    transition:
      ".3s transform cubic-bezier(.155,1.105,.295,1.12),.3s box-shadow,.3s -webkit-transform cubic-bezier(.155,1.105,.295,1.12)",
    margin: "20px",
    "&:hover": {
      transform: "scale(1.03)",
      boxShadow: "0 10px 20px rgba(0,0,0,.12), 0 4px 8px rgba(0,0,0,.06)",
    },
  },
  thumbnail: {
    height: "80px",
    width: "100%",
    backgroundColor: "#F0F0F0",
    color: "#007fac",
    padding: "20px",
    fontWeight: 500,
  },
  appCard: {
    display: "inline-block",
    marginTop: "20px",
  },
  learnMoreBtn: {
    backgroundColor: "#cc0033",
    color: "white",
    fontWeight: 500,
    "&:hover": {
      backgroundColor: "#007fac",
    },
  },
  dialogThumbnail: {
    height: "80vh",
    width: "80vw",
  },
  closeBtn: {
    float: "right",
  },
  pagination: {
    margin: "10px",
  },
}));

export default function Tab2() {
  const classes = useStyles();
  const [page, setPage] = useState(1);

  return (
    <div>
      <div className={classes.root}>
        <Navbar />
        <div className={classes.pageTitle}>Favorites</div>
        <Divider />
        <>
          <Grid>
            <Grid container spacing={2} alignItems="stretch"></Grid>
          </Grid>
          <div>
            <Pagination
              // count={Math.ceil(myPathRutgersData.length / itemsPerPage)}
              page={page}
              onChange={(e, value) => setPage(value)}
              defaultPage={1}
              size="medium"
              showFirstButton
              showLastButton
              className={classes.pagination}
            />
          </div>
        </>
      </div>
      <NavTabs />
    </div>
  );
}
